
from datetime import datetime
from collections import Counter


class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[]
        """
        rlist = []
    
        if len(p) > len(s):
            return []
        else:
            index = 0
            # print(index + len(p) - 1, len(s))
            # print(index + len(p))
            while index + len(p) - 1 < len(s):
                # print(index)
                k = s[index:index + len(p)]
                # print(len(k))
                # print(k == p)
                # exit(1)
                if k == p:
                    # print("same")
                    rlist.append(index)
                    index += 1
                else:
                    # print("else")
                    c1 = Counter(p)
                    c2 = Counter(k)
                    c3 = c2 - c1
                    # print(c1,c2,c3)
                    if len(c3.keys()) == 0:
                        rlist.append(index)
                    index += 1
                # print(rlist)
        return rlist

